CREATE TABLE IF NOT EXISTS `creature_template` (
  `entry` int(10) unsigned NOT NULL,
  `name` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`entry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `gameobject_template` (
  `entry` int(10) unsigned NOT NULL,
  `name` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`entry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `quest_template` (
  `entry` int(10) unsigned NOT NULL,
  `title` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`entry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


CREATE TABLE IF NOT EXISTS `smart_scripts` (
  `entryorguid` int(11) NOT NULL,
  `script_source_type` int(11) NOT NULL,
  `id` int(11) NOT NULL,
  `link` int(11) NOT NULL,
  `event_type` int(11) NOT NULL,
  `event_phase_mask` int(11) NOT NULL,
  `event_chance` int(11) NOT NULL,
  `event_flags` int(11) NOT NULL,
  `event_param1` int(11) NOT NULL,
  `event_param2` int(11) NOT NULL,
  `event_param3` int(11) NOT NULL,
  `event_param4` int(11) NOT NULL,
  `event_cooldown_min` int(11) NOT NULL,
  `event_cooldown_max` int(11) NOT NULL,
  `action_type` int(11) NOT NULL,
  `action_param1` int(11) NOT NULL,
  `action_param2` int(11) NOT NULL,
  `action_param3` int(11) NOT NULL,
  `action_param4` int(11) NOT NULL,
  `action_param5` int(11) NOT NULL,
  `action_param6` int(11) NOT NULL,
  `source_type` int(11) NOT NULL,
  `source_param1` int(11) NOT NULL,
  `source_param2` int(11) NOT NULL,
  `source_param3` int(11) NOT NULL,
  `source_condition_id` int(11) NOT NULL,
  `target_type` int(11) NOT NULL,
  `target_param1` int(11) NOT NULL,
  `target_param2` int(11) NOT NULL,
  `target_param3` int(11) NOT NULL,
  `target_condition_id` int(11) NOT NULL,
  `target_x` float NOT NULL,
  `target_y` float NOT NULL,
  `target_z` float NOT NULL,
  `target_o` float NOT NULL,
  `Comment` varchar(512) DEFAULT NULL,
  PRIMARY KEY (`entryorguid`,`script_source_type`,`id`,`link`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


